import React from 'react';
import styles from './HomePage.module.scss';  // CSS Modules

const HomePage = () => {
    return (
        <main className={styles.home}>
            <header className={styles.portfolioHeader}>
                <h1 className={styles.headerTitle}>
                    "In code as in tales, I craft worlds—one pixel, one line at a time."
                </h1>
                <p className={styles.headerSubtitle}>
                    — Rinat Nadav, weaver of web, words, and wonder.
                </p>
            </header>
            {/*<section className={styles.homeHero}>*/}
            {/*    <h1>In code as in tales, I craft worlds—one pixel, one line at a time.</h1>*/}
            {/*    /!*<p>I'm a Frontend Developer.</p>*!/*/}
            {/*    /!*<button className={styles.homeCta}>Explore my work</button>*!/*/}
            {/*    <p></p>*/}
            {/*</section>*/}

            <section className={styles.homeProjects}>
                <h2>Recent Projects</h2>
            </section>

            <section className={styles.homeAbout}>
                <h2>About Me</h2>
                <article>

                </article>
                <p>
                    Hello! I’m Rinat Nadav, a passionate web developer since 2020, dedicated to crafting engaging and dynamic user experiences. With a love for frontend development, I thrive on bringing ideas to life using JavaScript and CSS, always adhering to best practices for clean and efficient code.

                    My creative journey doesn’t stop at coding; I’m an avid reader and board game enthusiast who finds inspiration in fantasy and sci-fi classics like The Lord of the Rings and Jurassic Park. Whether I'm painting or drawing, I embrace minimalistic design, harmonizing beauty and functionality.

                    Residing in the serene landscapes of Finland, I draw inspiration from nature and music, infusing my work with a sense of wonder and creativity. Join me as I explore the intersection of technology and art, crafting websites that not only look great but also tell a story.</p>
            </section>
        </main>
    );
};

export default HomePage;
